[{"location":"","page":"Home","title":"Home","text":"CurrentModule = Robin2011_RepPackage","category":"page"},{"location":"#Robin2011_RepPackage","page":"Home","title":"Robin2011_RepPackage","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Robin2011_RepPackage.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [Robin2011_RepPackage]","category":"page"},{"location":"#Robin2011_RepPackage.SurplusVFI-Tuple{Matrix, Matrix, Matrix}","page":"Home","title":"Robin2011_RepPackage.SurplusVFI","text":"SurplusVFI(p::Matrix, z::Matrix, Π::Matrix; β::Number = 0.9466)\n\nPerforms Value Function Iteration on the Surplus Function, returns the resulting Surplus function matrix.\n\nTakes as inputs the matrix of match productivities p, the matrix of home production z, the markov transition matrix Π, and the parameter β as a keyword argument.\n\nβ should be set to equal (1-δ)/(1+r), it's default is the value used in Robin(2011).\n\n\n\n\n\n","category":"method"},{"location":"#Robin2011_RepPackage.grids-Tuple{}","page":"Home","title":"Robin2011_RepPackage.grids","text":"grids(; M = 500, N = 100, ρ = 0.913702234286476, σ = 0.0257,ν::Number = 2.019365636076711, μ::Number = 5.786082109731152 )\n\nThis function takes parameter values and constructs the grids and distributions of worker types and aggregate shocks, which it returns in a Dict.\n\n\n\n\n\n","category":"method"},{"location":"#Robin2011_RepPackage.homeprod-Tuple{Vector, Vector}","page":"Home","title":"Robin2011_RepPackage.homeprod","text":"homeprod(x::Vector, y::Vector; B::Number = 1, C::Number = 0.726, α::Number = 0.64, z0::Number = 0.767)\n\nTakes the worker and aggregate state grids, as well as the parameters B, C, α, and returns the matrix of home production.\n\nDefault parameter values are those used in Robin (2011).\n\n\n\n\n\n","category":"method"},{"location":"#Robin2011_RepPackage.matchprod-Tuple{Vector, Vector}","page":"Home","title":"Robin2011_RepPackage.matchprod","text":"matchprod(x::Vector, y::Vector; B::Number = 1, C::Number = 0.725767358913686)\n\nTakes the worker and aggregate state grids, as well as the parameters B and C, and returns the matrix of match productivities.\n\nDefault parameter values are those used in Robin (2011).\n\n\n\n\n\n","category":"method"}]
